const InterviewListCard = () => {
    return (
        <div >
            <h2>13th March, 2022</h2>
            <p>4pm to 6pm</p>
            <p>Interviewer: Plaban</p>
            <p>Participants: Glen, Rishabh, Kalindi</p>
        </div>
    );
};

export default InterviewListCard
